const tasks=[
    {
        id :1,
        text : 'Doctor',
        day : '5th august at 2:30pm ' ,
        reminder : true,
    },
    {
        id :2,
        text : 'Professor',
        day : '6th august at 5:30pm ' ,
        reminder : true,
    },
    {
        id :3,
        text : 'Shooping',
        day : '6th august at 7:30pm ' ,
        reminder : true,
    }
]

const Tasks = () => {
    const {tasks} = this.state;
  return (
    <>
        Object.keys(tasks).map((key) => ( 
          <h3>{key.text}</h3>
        ))
    </>
  )
}

export default Tasks
